PRAGMA foreign_keys=0;
PRAGMA ignore_check_constraints=1;
BEGIN TRANSACTION;
CREATE TABLE nixpkg(
  pname TEXT NOT NULL PRIMARY KEY UNIQUE,
  comment TEXT,
  disabled TEXT,
  dependency TEXT,
  description TEXT
);
CREATE TABLE rev(
  rev TEXT not null
  primary key
  unique,
  flakeref TEXT not null,
  ctime REAL default(unixepoch())
);
CREATE TABLE IF NOT EXISTS "nixpkg_rev"(
  pname TEXT not null
  references nixpkg,
  rev TEXT not null
  references rev,
  etc TEXT,
  primary key(pname, rev)
);
CREATE TABLE IF NOT EXISTS "nixpkg_rev_bin"(
  pname TEXT not null
  references nixpkg,
  bin TEXT not null,
  rev TEXT,
  primary key(rev, pname, bin)
);
COMMIT;
